import TextField from "@material-ui/core/TextField";
import Button from "@material-ui/core/Button";
import Menu from "@material-ui/core/Menu";
import MenuItem from "@material-ui/core/MenuItem";
import React from "react";

const Navigation = () => {
  const [anchorEl, setAnchorEl] = React.useState(null);

  const handleClick = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const handleClose = () => {
    setAnchorEl(null);
  };

  return (
    <div>
      <div className="navBar">
        <img
          src="https://res.cloudinary.com/robcg1102/image/upload/v1604355701/maq_img/logo_nqvtbv.png"
          alt=""
        />

        <TextField id="standard-basic" label="Buscar producto..." />

        <div className="options">
          <div className="optionMenu">
            <i class="ri-user-3-fill"></i>
            <p>Mi cuenta</p>
          </div>
          <div className="optionMenu">
            <i class="ri-heart-fill"></i>
            <p>Mis favoritos</p>
          </div>
          <div className="optionMenu">
            <i class="ri-upload-fill"></i>
            <p>Cargar pedido masivo</p>
          </div>
          <div className="optionMenu">
            <i class="ri-shopping-cart-2-fill"></i>
            <p>Mi carrito</p>
          </div>
        </div>
      </div>
      <div class="barDrop">
        <div className="menuDrop">
          <div>
            <Button
              aria-controls="simple-menu"
              aria-haspopup="true"
              onClick={handleClick}
            >
              Departamentos <i class="ri-arrow-drop-down-line"></i>
            </Button>
            {/* <Menu
                id="simple-menu"
                anchorEl2={anchorEl2}
                keepMounted
                open={Boolean(anchorEl2)}
                onClose={handleClose2}
              >
                <MenuItem onClick={handleClose}>Profile</MenuItem>
                <MenuItem onClick={handleClose}>My account</MenuItem>
                <MenuItem onClick={handleClose}>Logout</MenuItem>
              </Menu> */}
          </div>
          <div>
            <Button
              aria-controls="simple-menu"
              aria-haspopup="true"
              onClick={handleClick}
            >
              Marcas <i class="ri-arrow-drop-down-line"></i>
            </Button>
            <Menu
              id="simple-menu"
              anchorEl={anchorEl}
              keepMounted
              open={Boolean(anchorEl)}
              onClose={handleClose}
            >
              <MenuItem onClick={handleClose}>Coflex</MenuItem>
              <MenuItem onClick={handleClose}>Phillips</MenuItem>
              <MenuItem onClick={handleClose}>Steren</MenuItem>
              <MenuItem onClick={handleClose}>Teka</MenuItem>
              <MenuItem onClick={handleClose}>Truper</MenuItem>
            </Menu>
          </div>
        </div>
        <div className="price-tag">
            <p>OFERTAS <i class="ri-price-tag-3-fill"></i></p>
        </div>
      </div>
    </div>
  );
};
export default Navigation;
